import { useSelector } from "react-redux";
import { UserData } from "../Components/UserData/UserData";
import { selectObjectById } from "../store/Objects/selectors";

export const ObjectDataContainer = ({onclick, id, filter, selectedRow}) => {

    const object = useSelector(state => selectObjectById(state, { id }));
    const data = [object.IDSRV, object.NAME, object.CITY, object.PHONE, object.DT.substr(0, object.DT.indexOf("T")), object.FRAN_NAME, object.AMOUNT]


    return (
        <UserData data={data} ondoubleclick={onclick} selectedRow={selectedRow}/>
    )
}
